import React from 'react';
import { Box, Center, Button, ButtonText, ButtonIcon, ButtonGroup, Icon, AddIcon, InfoIcon, ButtonSpinner, ArrowUpIcon, Heading, Text, HStack, VStack, ThreeDotsIcon, Input, InputField } from '@gluestack-ui/themed';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
const Tab = createBottomTabNavigator();
const Button1 = () => {
    <Box {...props} bg={`$${bg}`} h={h} w={w} justifyContent="center" alignItems="center">
        <Text color="white" fontWeight="$bold">
            BOX
        </Text>
    </Box>;
};
const Button2 = () => {
    <Button action={"primary"} variant={"solid"} size={"lg"} isDisabled={false}>
        <ButtonText>
            Button
        </ButtonText>
    </Button>;
};
const HomeView = () => {
    return <Tab.Navigator>
        <Tab.Screen name="Button1" component={Button1} options={{
            headerShown: false
        }} />
        <Tab.Screen name="Button2" component={Button2} />
    </Tab.Navigator>;
};
export default HomeView;
